import re


def extract_dynamic_variables(log):
    pattern = r'\{\w+\}'
    return re.findall(pattern, log)


def generate_template(log):
    pattern = r'\{(?P<key>\w+)\}'
    keys = extract_dynamic_variables(log)
    for key in keys:
        pattern = pattern.replace('{' + key + '}', '{{{}}}', 1)
    return re.sub(pattern, '', log)



